import './App.css';
import {sampleText} from './sampleText';
import { Component } from 'react';

class App extends Component {
  render() {
    return (
      <div className='container'>
        <div className='row'>
          <div className='col-sm-6'>
            <textarea value={sampleText} 
            className='form-control' rows='35'>
            </textarea>
          </div>
          <div className='col-sm-6'>
            <h1>Resultat</h1>
        </div>
      </div>
    </div>
  );
}
}
export default App;
